import React from "react";
import { Container, Grid, TextField, Typography } from "@material-ui/core";

const style = {

  // marginTop = a un margen superior de 8-- display: "flex" = 1 tras otro
  // flexDirection: "column" = fomato q se deben organizar los obj dentro del div = a 1 detras d otro en est caso
  paper: {
    marginTop: 8,
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
  form: {
    width: "100%",
    marginTop: 20,
  },
};

//F q representa nuestro 1er comp REACT
//declaramos la f como const
const RegistrarUsuario = () => {
  //Creamos la interfaz grafica d este comp
  return (
    <Container component="main" maxWidth="md" justify="center">
      <div style={style.paper}>
        <Typography component="h1" variant="h5">
          Registro de Usuario
        </Typography>

        {/*item cuando sea 1 telefo 'xs 12' ocupara toda la pantalla, si es desktop sera 'md 6'  */}
        <form style={style.form}>
          <Grid container spacing={2}>
            <Grid item xs={12} md={6}>
              <TextField
                name="nombre"
                variant="outlined"
                fullWidth
                label="Ingrese su nombre"
              />
            </Grid>

            <Grid item xs="12" md={6}>
              <TextField
                name="apellidos"
                variant="outlined"
                fullWidth
                label="Ingrese su apellido"
              />
            </Grid>

            <Grid item xs="12" md={6}>
              <TextField
                name="username"
                variant="outlined"
                fullWidth
                label="Ingrese su username"
              />
            </Grid>

            <Grid item xs="12" md={6}>
              <TextField
                name="password"
                variant="outlined"
                fullWidth
                label="Ingrese su password"
              />
            </Grid>

            <Grid item xs="12" md={6}>
              <TextField
                name="confirmacionpassword"
                variant="outlined"
                fullWidth
                label="Confirme su password"
              />
            </Grid>
          </Grid>
        </form>
      </div>
    </Container>
  );
};

export default RegistrarUsuario;
